import { Component } from '@angular/core';
import {ApiService} from "../services/api/api.service";
import {JokeParam} from "../models/joke.model";
import {Observable} from "rxjs";

@Component({
  selector: 'app-tab1',
  templateUrl: 'tab1.page.html',
  styleUrls: ['tab1.page.scss']
})
export class Tab1Page {

  jokes$: Observable<JokeParam>[] = [];

  constructor(
    private apiService: ApiService
  ) {}

  getJoke(){
    this.jokes$.push(this.apiService.getJoke());
    this.jokes$.forEach(value => {
      value.forEach(value1 => {
        console.log(value1);
      })
    })
  }

}
<ion-header [translucent]="true">
  <ion-toolbar>
    <ion-title>
      Tab 1
    </ion-title>
  </ion-toolbar>
</ion-header>

<ion-content [fullscreen]="true">
  <ion-header collapse="condense">
    <ion-toolbar>
      <ion-title size="large">Jokes</ion-title>
    </ion-toolbar>
  </ion-header>

  <ion-list>
    <ion-item>
      <ion-select placeholder="Select category">
        <ion-select-option value="any">Any</ion-select-option>
        <ion-select-option value="misc">Misc</ion-select-option>
        <ion-select-option value="dark">Dark</ion-select-option>
        <ion-select-option value="pun">Pun</ion-select-option>
        <ion-select-option value="programming">Spooky</ion-select-option>
      </ion-select>
    </ion-item>
  </ion-list>



  <ion-button (click)="getJoke()">Get joke</ion-button>


</ion-content>
